import React, {useState} from 'react';
import ReactDOM from 'react-dom';
import './index.css';


function App() {
  const [val1, setVal1] = useState("defaultVal1");
  const [val2, setVal2] = useState("defaultVal2");
  return (
      <div>

        <div><input type="text" value={val1}/></div>
        <br/>
        <div><input type="text" value={val2}/></div>
      </div>
  );
}

ReactDOM.render(
    <App/>,
    document.getElementById('root')
);
